import ReactDOM from 'react-dom';  //  with babel
import "./index.css"

// ReactDOM.render("What to See" , "Where to Show" ,  "call back functions") ;
ReactDOM.render(
  <React.Fragment>
    <h1>NetFlix</h1>
    <p>Top five NetFlix Series</p>
  </React.Fragment>

  , document.getElementById("root"));


ReactDOM.render(
  <React.Fragment>
    <h2>Title</h2>
    <p>Discription</p>
    <a>Read More</a>
  </React.Fragment>

  , document.getElementById("category1"));
